Pixar Short Films Collection Volume 2 (2012) 1080p ENG-ITA-POR-SPA x264 bluray (12 Shorts + 7 Extras)



Compilation of the Pixar short animated films. It features 12 shorts that were released from 2007 through 2012 and it includes some student films from Pixar's directors as a bonus feature.


